import React from "react";

export default class Tryout extends React.Component {
  render() {
    return (
      <div>
        <div class="form-group row">
          <div class="col-xs-3">
            <label for="ex1">First name</label>
            <input class="form-control" id="fname" type="text" />
          </div>
          <div class="col-xs-3">
            <label for="ex2">Last Name</label>
            <input class="form-control" id="lname" type="text" />
          </div>
          <div class="col-xs-3">
            <label >Employee Id</label>
            <input class="form-control"  type="text" />
          </div>
        </div>
      </div>
    );
  }
}
